const Rating=({rating})=>{
  return(
    <div className="rating">
        {rating>=1?<i className="bi bi-star-fill"></i>
        : rating>=0.5 ? <i className="bi bi-star-half"></i>
        : <i className="bi bi-star"></i>
        }
        rating>=2?<i className="bi bi-star-fill"></i>
        : rating>=0.5 ? <i className="bi bi-star-half"></i>
        : <i className="bi bi-star"></i>
        }
    </div>
  );
}

export default Rating;
